import React from "react";
import { Products } from "../App";

interface Props {
  products: Products[];
}

const ProductTable: React.FC<Props> = ({ products }) => {
    let lastCategory: string | null = null;

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product) => {
          return (
            <tr key={product.name}>
              <td>{product.name}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default ProductTable;
